class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        m = len(board)
        n = len(board[0])

        index_max = [[-1] * 3 for _ in range(m)]

        for i in range(m):
            k = index_max[i]
            for j in range(n):
                if k[0] < 0 or board[i][j] >= board[i][k[0]]:
                    k[0], k[1], k[2] = j, k[0], k[1]
                elif k[1] < 0 or board[i][j] >= board[i][k[1]]:
                    k[1], k[2] = j, k[1]
                elif k[2] < 0 or board[i][j] >= board[i][k[2]]:
                    k[2] = j

        ret = -9999999999

        for i in range(m):
            for j in range(m):
                for k in range(m):
                    if i != j and j != k and i != k:
                        a = index_max[i][0]
                        b = index_max[j][0]
                        if b == a:
                            b = index_max[j][1]

                        c = index_max[k][0]
                        if c == a or c == b:
                            c = index_max[k][1]

                        if c == a or c == b:
                            c = index_max[k][2]

                        ret = max(ret, board[i][a] + board[j][b] + board[k][c])

        return ret
